import Navbar from "./navbar";
function Layout(props) {
    return (
        <div className="layout">
            <GlobalHeader/>
               <Navbar/>
            <style jsx>{`
                .layout{
                    font-size:2rem;
                    color:red;
                    height:100vh;
                    width:100%;
                    background-color:red;
                }
                `} </style>
            {props.children}
        </div>
        
  )
  
}
export default Layout;
function GlobalHeader() {
    return (
        <Head>
            <title>Trial</title>
            <link rel="stylesheet" href="/css/global.css" />
       </Head>
    )
    
}
